:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Frederick Wanklyn and BRAITHWAITE, Elina Mary
  WILLIAMS, Frederick Wanklyn and BRAITHWAITE, Elina Mary (cont...)
  shot. He was a constant attendant at the New Zealand Rifle Association meetings and a member of its council.
  When in England in 1899 he won the armourer's prize for 900 yards at Bisley. For several years he acted as
  range officer for the Coleman Shield competition.
  At 80 years of age he began to write his memoirs which was published just prior to his death.
  Publications by F W Williams
  "Through Ninety Years".
  01> WILLIAMS, Ronald Wanklyn m on 04.09.1918 to FITZROY, Louisa Gwendoline
  1'Strang
  b 01.09.1884 d ** **.1963
  b ** ** ****
  Ronald b, at Napier and d. at Wellington.
  LA
  01> WILLIAMS, Frederick Wanklyn m on 03.07.1912 to (2)STANDISH, Kate Constance
  b 13.10.1854 d 27.07.1940
  b 08.03.1878 d 16.04.1961
  Frederick m. at Ashburton. Kate, d/o Frank Burgon Standish and Fanny Hould. She was a sister to Edith Standish
  who married Francis James Volkner Williams under whose entry are some notes about Kate's father.
  01> WILLIAMS, Peter Standish m on 06.09.1939 to WHITE, Laila Moore (Kewpie)
  b 09.04.1913 d 26.02.1992
  b 18.11.1917
  Peter b. at Napier, m. at Hastings and d. at Taupo. Kewpie, d/o Norman Moore White and Constance Richmond.
  Peter gained a Sheep Farming Diploma at Massey College in 1935 and was a sheep and cattle farmer at
  "Rotokare" in Hawkes Bay (1933-79). He retired to Taupo.
  Refer to "The Family of Thomas and Jane Mason of Taita" published by Evagean Publishing in 1994 for records
  of Kewpie's family.
  01> WILLIAMS, Gary Standish m on 12.06.1971 to (1) PRICE, Carolyn Joy
  b 23.09.1947
  b 09.04.1950
  Gary b. at Napier and m. at Sydney, Australia. Carolyn, d/o IB Price, b. at Sydney.
  01> WILLIAMS, Tara Gay m on 30.05.1998 to KLOSE, Malcolm Jeffrey
  b 02.11.1972
  b 02.12.1970
  Tara b. at Hastings. She was educated at Napier Girls' High School and EIT. She toured Europe,
  the British Isles and Africa in 1994-95 and worked for a merchant bank in London during that time.
  She is now employed by Ericsson Communications in Napier.
  02> WILLIAMS, Emma Jean
  b 02.05.1974
  Emma b. at Hastings. She was educated at Napier Girls' High School and graduated Bachelor of Food
  Technology (Hons) from Massey University in 1996. She is currently Assistant Winemaker at
  Stoneyridge Vineyard on Waiheke Island.
  03> WILLIAMS, Bennet Standish
  b 20.05.1977
  Bennet b. at Hastings. He was home schooled and has spent two years at Castlepoint Station in the
  Wairarapa where he is head shepherd, He has his private pilot's licence.
  01> WILLIAMS, Gary Standish m on 04.08.1984 to (2) NANT, Jacqueline
  b 23.09.1947
  b 28.01.1949
  Marriage dissolved 5 July 1989. Address: Rotokare, PB 6301, Napier.
  Gary farms the family property, "Rotokare", a dry hill-country grazing property 10km inland from
  Napier. He is a keen forester and has a small import and distributing business dealing mainly in a
  wood treatment and oil finishes for wood.
